<script>
import gsap from 'gsap'
import { directive } from 'vue-awesome-swiper'
import LinkResolver from '~/plugins/link-resolver.js'
export default {
  name: 'HomePage',
  components: {},
  directives: {
    swiper: directive,
  },
  async asyncData({ $prismic, error }) {
    try {
      const pageContent = (await $prismic.api.getSingle('home_page')).data
      // Query projects
      const recentprojects = await $prismic.api.query(
        $prismic.predicates.at('document.type', 'project'),
        {
          orderings: '[my.project.date desc]',
          pageSize: 4,
        }
      )
      return {
        page: pageContent,
        title: pageContent.title,
        titleWords: Array.from($prismic.asText(pageContent.title).split(' ')),
        backgroundColor: pageContent.backgroundColor,
        textColor: pageContent.textColor,
        recentprojects: recentprojects.results,
        intro: pageContent.intro,
        homedescription: Array.from(
          'Vast is a design studio with a focus on branding and communication, digital design and web development, as well as interior design and architectural visualization.'.split(
            ' '
          )
        ),
      }
    } catch (e) {
      error({ statusCode: 404, message: 'Page not found' })
    }
  },
  data() {
    return {
      page: null,
      swiperOption: {
        effect: 'fade',

        autoplay: {
          delay: 100,
        },
        loop: true,
        navigation: {
          nextEl: '.swiper-button-next',
          prevEl: '.swiper-button-prev',
        },
      },
    }
  },
  head() {
    return {
      title: this.page.metaTitle,
      meta: [
        {
          hid: 'description',
          name: 'description',
          content: this.page.metaDescription,
        },
      ],
    }
  },
  beforeMount() {
    document.documentElement.style.setProperty('--bg', this.backgroundColor)
    document.documentElement.style.setProperty(
      '--color-primary',
      this.textColor
    )
    document.documentElement.style.setProperty('--color', this.textColor)
  },
  mounted() {
    window.addEventListener('scroll', this.headerScroll)
    const gsap = this.$gsap
    const ExpoScaleEase = this.$ExpoScaleEase
    const ScrollToPlugin = this.$ScrollToPlugin
    const ScrollTrigger = this.$ScrollTrigger
    gsap.registerPlugin(ScrollToPlugin, ScrollTrigger, ExpoScaleEase)
    this.$ScrollTrigger.refresh()
    this.heroAnimation()
  },
  updated() {
    this.$ScrollTrigger.refresh()
  },
  destroyed() {
    window.removeEventListener('scroll', this.headerScroll)
  },
  methods: {
    LinkGetter(post) {
      return LinkResolver(post)
    },
    heroAnimation() {
      gsap.set('.title-words:nth-child(n+6)', {
        opacity: 0,
      })
      gsap.set('#header-text', {
        translateY: '0',
      })
      gsap.set('.intro', {
        opacity: 0,
      })
      gsap.to('.home-hero-logo', {
        scrollTrigger: {
          trigger: '.home-header',
          start: 'top top',
          end: 'bottom bottom',
          scrub: 2,
        },
        opacity: 0.25,
        duration: 1,
        stagger: 1,
      })
      gsap.to('#header-text', {
        scrollTrigger: {
          trigger: '.home-header',
          start: 'bottom bottom',
          end: 'bottom 50%',
          scrub: true,
        },
        translateY: '-8em',
      })
      gsap.to('.title-words:nth-child(n+6)', {
        scrollTrigger: {
          trigger: '#header-text',
          start: 'top 25%',
          end: 'bottom bottom',
          scrub: 2,
        },
        opacity: 1,
        duration: 1,
        stagger: 0.2,
      })
      gsap.to('.title-words:not(:nth-child(n+6))', {
        scrollTrigger: {
          trigger: '#header-text',
          start: 'top 25%',
          end: '90% bottom',
          scrub: 2,
        },
        opacity: 0.3,
        duration: 1,
        stagger: 0.2,
      })
      gsap.to('#markerunderline', {
        scrollTrigger: {
          trigger: '.title-words:nth-child(11)',
          start: 'top 50%',
          end: 'top 50%',
          scrub: 1,
        },
        strokeDashoffset: 0,
      })
      gsap.to('.digital-underline', {
        scrollTrigger: {
          trigger: '.title-words:nth-child(13)',
          start: 'top 50%',
          end: 'top 50%',
          scrub: 1,
        },
        width: '92%',
      })
      gsap.to('.intro', {
        scrollTrigger: {
          trigger: '#header-text',
          start: '90% bottom',
          end: 'bottom bottom',
          scrub: 2,
        },
        opacity: 1,
        duration: 1,
      })
      gsap.to('.scroll-down-button', {
        scrollTrigger: {
          trigger: '.scroll-down-button',
          start: 'bottom bottom',
          end: 'bottom 50%',
          scrub: 1,
        },
        opacity: 0,
        duration: 1,
      })
      const scrollerslides = document.getElementsByClassName('scroller-slide')
      const scrollertitles = document.getElementsByClassName('scroller-title')
      const scrollerimages = document.getElementsByClassName('scroller-image')
      const scrollerimagecontainers = document.getElementsByClassName(
        'scroller-image-container'
      )
      for (let i = 0; i < scrollerslides.length; i++) {
        gsap.set(scrollertitles[i], {
          opacity: 0,
        })
        gsap.to(scrollertitles[i], {
          scrollTrigger: {
            trigger: scrollerimagecontainers[i],
            start: '50% 50%',
            end: '50% 50%',
            scrub: 1,
          },
          opacity: 1,
        })
        gsap.set(scrollerslides[i], {
          y: '0%',
        })
        gsap.to(scrollerslides[i], {
          scrollTrigger: {
            trigger: scrollerslides[i],
            start: 'top bottom',
            end: 'bottom top',
            scrub: 2,
          },
          y: '-50%',
        })
        gsap.set(scrollerimages[i], {
          y: '-20%',
          scale: 1.4,
        })
        gsap.to(scrollerimages[i], {
          scrollTrigger: {
            trigger: scrollerimagecontainers[i],
            start: 'top bottom',
            end: 'bottom top',
            scrub: true,
          },
          y: '20%',
        })
      }
    },
  },
}
</script>
